            function loadMore(){
            getData(startDate.toISOString().substring(0, 10));
            startDate.setDate(startDate.getDate() - 1);
            $("#nextButton").text("Load " + startDate.toISOString().substring(0, 10));

            function getData(dateString){
            $('#tableTarget').append('<table id="targetTable' + dateString + '" style="border-spacing: 0px;"><tr id="targetTableTitles' + dateString + '"><td>' + dateString + '</td></tr></table>');
            var locationParam = window.location.search.split('?')[1].split('&')[0];
            var typeParam = window.location.search.split('?')[1].split('&')[1];
            var colourValue = parseFloat(window.location.search.split('?')[1].split('&')[2]);
            var dataIndex = (typeParam == "rms")?2:(typeParam == "avg")?3:1;
            var typeString = (dataIndex == 2)?'RMS':(dataIndex == 3)?'Average':'Peaks';
            $('#titleTarget').html('<h1>' + locationParam + ' ' + typeString + ' ' + colourValue + '</h1>');
            $.getJSON('/monitor/magnitudes?location=' + locationParam + '&date=' + dateString,
                    function(data){
                    $.each(data,
                            function(key1, value1){
//            $.each(sampleData, function(key1, value1) {
                            if (!key1.endsWith('maxMsError')){
                            var columnCount = $('#targetTableTitles' + dateString).children('td').length;
                            var requiredColumns = parseInt(key1.substring(0, 2)) * 3;
                            for (index = columnCount; index <= requiredColumns; index++) {
                            $('#targetTableTitles' + dateString).append('<td style="max-width:10px; font-size: 8px; transform: rotate(90deg);"">__:__</td>');
                            }
                            $('#targetTableTitles' + dateString).append('<td style="max-width:10px; font-size: 8px; transform: rotate(90deg);"">' + key1 + '</td>');
                            $.each(value1.split(';'), function(key2, value2) {
                            var splitValue2 = value2.split(' ');
                            if (splitValue2.length > 1){
                            var idKey = 'k' + splitValue2[0].replace('.', '-');
                            if ($('#' + idKey + dateString).length === 0) {
                            $('#targetTable' + dateString + ' tr:first').after('<tr id="' + idKey + dateString + '">');
                            $('#' + idKey + dateString).append('<td>' + splitValue2[0] + '</td>');
                            }
                            for (index = columnCount; index <= requiredColumns; index++) {
                            $('#' + idKey + dateString + ' td:last').after('<td></td>');
                            }
                            $('#' + idKey + dateString + ' td:last').after('<td style="max-width:10px; font-size: 3px; overflow: hidden; text-overflow: ellipsis; background:hsl(' + (Math.min((splitValue2[dataIndex] / colourValue) * 360, 360 - 50) + 50) + ', 100%, 50%);">' + splitValue2[dataIndex] + '</td>');
//                rgb(' + Math.round(splitValue2[dataIndex] / 8) + ', 0, ' + (255 - Math.round(splitValue2[dataIndex] / 2)) + ')
                            //$('#targetTable' + dateString + '').append('<tr>').append('<td>').attr('style', 'background:green;').text(key);
                            }   });
                            }
                            });
